create table Employee (
	EmployeeId INT,
	Email VARCHAR(50),
	FirstName VARCHAR(50),
	LastName VARCHAR(50),
	Department VARCHAR(255),
	Office VARCHAR(50),
	PrimaryIndustry VARCHAR(255),
	Sector VARCHAR(255),
	MandatoryRetirement DATE,
	Gender VARCHAR(50),
	Race VARCHAR(50),
	DirectAdmit BIT,
	LastReview DATE,
	Status BIT,
	OriginalHireDate DATE,
	ExperienceCredit INT
);
